import React, { useState, useEffect } from "react";


// mysql 연동 과정

import "../styles/App.css";
import HomeImage from "../assets/home.png";
import TodayImage from "../assets/today.png";
import CHImage from "../assets/ch.png";
import RingImage from "../assets/ring.png";
import ComImage from "../assets/com.png";
// import 이미지 들

function Today() {
  const [message, setMessage] = useState([]);
  useEffect(() => {
    fetch("/hello")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setMessage(data);
      });
  }, []);

  const contentWrapperStyle = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "space-between",
    width: "100%",
    height: "auto",
    background: "#F7D358",
    padding: "40px 0 120px 0",
  };

  const centerWhiteStyle = {
    width: "80%",
    height: "auto",
    background: "white",
    display: "flex",
    margin: "0 auto",
    justifyContent: "space-between",
    flexDirection: "column",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.2)",
  };

  const homeWrapperStyle = {
    display: "flex",
    alignItems: "center",
    marginBottom: "10px",
  };

  const homeImageStyle = {
    width: "45px",
    height: "45px",
  };

  const homeTextStyle = {
    fontSize: "22px",
    fontWeight: "bold",
    textAlign: "left",
    marginLeft: "4px",
  };

  const tabImageStyle = {
    width: "35px",
    height: "35px",
    margin: "7px",
    padding: "5px 20px 20px 20px",
  };

  const tabtext = {
    fontSize: "15px",
    fontWeight: "bold",
    textAlign: "center",
    margin: "-25px 0 3px 0",
  };

  const bottomTabStyle = {
    width: "100%",
    height: "auto",
    background: "white",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: "4px",
    position: "fixed",
    bottom: "0",
    zIndex: "1",
    boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.2)",
  };

  const appBackgroundStyle = {
    width: "90%",
    height: "auto",
    background: "transparent",
    border: "1px solid grey",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    padding: "20px",
    borderRadius: "10px",
    zIndex: "0",
    position: "relative",
    margin: "10px",
  };

  const handleHomeImageClick = () => {
    window.location.href = "./Today.js";
  };

  const handleTodayImageClick = () => {
    window.location.href = "./today.js";
  };

  const handleCHImageClick = () => {
    window.location.href = "./ch.js";
  };

  const handleRingImageClick = () => {
    window.location.href = "/ring.js";
  };

  const handleComImageClick = () => {
    window.location.href = "/com.js";
  };

  return (
    <div className="App">
      <ul>
        {Array.isArray(message) ? (
          message.map((v, idx) => <li key={`${idx}-${v}`}>{v}</li>)
        ) : (
          <li>서버연동 성공 </li>
        )}
      </ul>

      <div style={contentWrapperStyle}>
        <div style={centerWhiteStyle}>
          <div style={homeWrapperStyle}>
            <img
              src={HomeImage}
              alt="home"
              style={{ ...homeImageStyle }}
              onClick={handleHomeImageClick}
            />
            <span style={homeTextStyle}>오늘의 소식</span>
          </div>

          <div
            style={{
              justifyContent: "center",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <div style={appBackgroundStyle}>
              <p>내용 1</p>
            </div>
            <div style={appBackgroundStyle}>
              <p>내용 2</p>
            </div>
            <div style={appBackgroundStyle}>
              <p>내용 3</p>
            </div>
            <div style={appBackgroundStyle}>
              <p>내용 4</p>
            </div>
            <div style={appBackgroundStyle}>
              <p>내용 5</p>
            </div>
            <div style={appBackgroundStyle}>
              <p>내용 6</p>
            </div>
            <div style={appBackgroundStyle}>
              <p>내용 7</p>
            </div>
            <div style={appBackgroundStyle}>
              <p>내용 8</p>
            </div>
          </div>
        </div>
      </div>
      <div style={bottomTabStyle}>
        <div>
          <img
            src={TodayImage}
            alt="Today"
            style={tabImageStyle}
            onClick={handleTodayImageClick}
          />
          <p style={tabtext}>투데이</p>
        </div>
        <div>
          <img
            src={CHImage}
            alt="CH"
            style={tabImageStyle}
            onClick={handleCHImageClick}
          />
          <p style={tabtext}>추천</p>
        </div>
        <div>
          <img
            src={RingImage}
            alt="Ring"
            style={tabImageStyle}
            onClick={handleRingImageClick}
          />
          <p style={tabtext}>알림</p>
        </div>
        <div>
          <img
            src={ComImage}
            alt="Com"
            style={tabImageStyle}
            onClick={handleComImageClick}
          />
          <p style={tabtext}>소통</p>
        </div>
      </div>
    </div>
  );
}

export default Today;
